            height: auto;
            position: absolute;
            top: 0;
            left: 0;
            display: none;
        }

        .postcard img.active {
            display: block;
        }

    <script>
        function changeImage() {
            var frontImage = document.querySelector('.front');
            var backImage = document.querySelector('.back');
            
            if (frontImage.classList.contains('active')) {
                frontImage.classList.remove('active');
                backImage.classList.add('active');
            } else {
                frontImage.classList.add('active');
                backImage.classList.remove('active');
            }
        }
